(6, 'Terms of use', 'terms-of-use', '<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt;line-height:normal\"><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">(MDBT) Me3c Digital building Technologies LLC <b>4.4</b>&nbsp;Documents\r\ncontained on the App are copies of originals held by the Architect or Engineer.\r\nIn any instance where conflicting information is found between the documents on\r\nthe App and the originals, the original documents will control. The presence of\r\nproject information and/or documents on the App in no way obligates the\r\nArchitect, Engineer or owner to provide additional or updated bidding documents\r\nreleased as addenda to ME3C.COM.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt;line-height:normal\"><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">4.5</span></b><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;User’s\r\nobligations under this Section 4 shall survive termination of this Agreement.\r\nUser acknowledges that a breach of its obligations under this Section 4 will\r\ncause irreparable harm to ME3C.COM , and/or their licensors for which monetary\r\ndamages would be inadequate. ME3C.COM and/or their licensors will be entitled\r\nto injunctive relief for any such breaches, threatened or actual.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;mso-line-height-alt:13.2pt;\r\nmso-outline-level:3\"><b><span style=\"font-size:16.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">5. User Responsibilities<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt;line-height:normal\"><b><span style=\"font-size:12.0pt;font-family:&q