-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;This\r\nagreement can be terminated by the User with 30 days’ notice upon expiration of\r\nthe initial subscription period selected during the Purchase Process. No\r\nportion of User’s subscription fees will be refunded upon early termination of\r\nthis Agreement. This Agreement shall automatically renew for successive renewal\r\nterms of one (1), twelve (12) or thirty-six (36) months each, depending upon\r\nthe User’s choice and subscription fees shall be automatically charged to\r\npreviously used credit card information if available, unless User provides 30\r\nday notice to ME3C.COM prior to the end of the renewal term. User will be\r\ncharged the subscription fees in effect at the time of renewal.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt;line-height:normal\"><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">7.2</span></b><span style=\"font-size:12.0pt;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;No\r\ntermination of this Agreement or suspension of access to the App shall release\r\nUser from any obligation to pay ME3C.COM any amount that has accrued or becomes\r\npayable at or prior to the date of termination. User shall not be entitled to\r\nany refund of any fees paid to ME3C.COM as a result of a termination.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:7.5pt;mso-line-height-alt:13.2pt;\r\nmso-outline-level:3\"><b><span style=\"font-size:16.5pt;font-family:&quot;Arial&quot;,sans-serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\">8. Warranties<o:p></o:p></span></b></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:12.0pt;line-height:normal\"><b><span style=\"font-size:12.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman